food like fish, nuts, avocado). Exercising regularly, Not taking food atleast 90 minutes before sleeping and Stopping smoking.</p>','80',NULL,'2023-10-31 03:29:01','0 - 150'),(12,NULL,0,'Creatinine',NULL,'<p>Creatinine is a waste product that is produced by the body when muscles break down creatine phosphate. The kidneys then remove creatinine from the body and is passed out in urine. The creatinine level in the blood can be used to assess kidney function.</p>','<p>3 months</p>','<p>6 weeks</p>','Both','<p>Low creatinine levels are not usually a cause for concern. However, they can sometimes be a sign of muscle wasting</p>','<p>Increased creatinine levels can indicate high protein diet, kidney disease, dehydration, or muscle damage. People with more muscle mass tend to have slightly higher creatinine levels.</p>','','1.4 - 1.6','0.7 - 1.3','','1.7 - 10000','<p>If you have low creatinine, your doctor may evaluate for on the underlying cause. Thinner individuals generally tend to have lower creatinine levels.</p>','<p>If you have high creatinine levels, it is important to see a doctor to determine the cause and get the appropriate treatment</p>','95',NULL,'2023-10-31 03:29:08','18 - 60'),(13,NULL,0,'Creatinine',NULL,'<p>Creatinine is a waste product that is produced by the body when muscles break down creatine phosphate. The kidneys then remove creatinine from the body and is passed out in urine. The creatinine level in the blood can be used to assess kidney function.</p>','<p></p>','<p></p>','Both','<p>Low creatinine levels are not usually a cause for concern. However, they can sometimes be a sign of muscle wasting</p>','<p>Increased creatinine levels can indicate high protein diet, kidney disease, dehydration, or muscle damage. People with more muscle mass tend to have slightly higher creatinine levels.</p>','','1.4 - 1.6','0.8 - 1.3','','1.7 - 10000','<p>If you have low creatinine, your doctor may evaluate for on the underlying cause. Thinner individuals generally 