- 1000','<p>If you are on anti-diabetic medications, consult with your doctor once in 6 weeks on regulating them.</p>','<p>Low carbohydrate diet (Take less rice, wheat, bread. Avoid sugary products) and include more vegetables, nuts, berries, yoghurt, chicken, fish. Atleast 14 hours of fasting between dinner and breakfast (water, black coffee &amp; black tea without sugar can be taken during fasting). Medications / insulin may be needed for uncontrolled diabetes.</p>','116',NULL,'2023-10-31 03:29:40','0 - 150'),(16,NULL,0,'Gamma glutamyl transferase (GGT)',NULL,'<p>Gamma-glutamyl transferase (GGT) is an enzyme found in many tissues in the body, including the liver, pancreas, kidneys, and small intestine. It is involved in the metabolism of amino acids and other substances.</p>','<p>6 months</p>','<p>3 months</p>','Male','<p>-</p>','<p>Mild increase can be due to smoking or alcohol intake. Significantly Increased GGT levels can be due to liver disease, bile duct obstruction, drugs like acetaminophiin, heparin, oral contraceptives</p>','','56 - 75','0 - 55','','76 - 10000','<p>-</p>','<p>The treatment for significantly increased GGT levels depends on the underlying cause. Quitting smoking and alcohol intake.</p>','120',NULL,'2023-10-31 03:30:14','0 - 150'),(17,NULL,0,'Gamma glutamyl transferase (GGT)',NULL,'<p>Gamma-glutamyl transferase (GGT) is an enzyme found in many tissues in the body, including the liver, pancreas, kidneys, and small intestine. It is involved in the metabolism of amino acids and other substances.</p>','<p></p>','<p></p>','Female','<p>-</p>','<p>Mild increase can be due to smoking or alcohol intake. Significantly Increased GGT levels can be due to liver disease, bile duct obstruction, drugs like acetaminophiin, heparin, oral contraceptives</p>','','39 - 50','0 - 38','','51 - 10000','<p>-</p>','<p>The treatment for significantly increased GGT levels depends on the underlying cause. Quitting smoking and alcohol intake.</p>','120',NULL,'2023-10-31 03:30:32','0 - 150'),(18,NULL,0,'Glucose post prandial (PPBS)',NULL,'<p>A measure of your blood sugar level 2 hours after you have eaten. High levels of postprandial glucose can be due to a heavy meal, prediabetes o</p>','<p>3 months</p>','<p>6 weeks</p>','Both','<p>Decreased post prandial glucose levels can indicate hypoglycemia and is usually caused due to anti-diabetetic medications.</p>','<p>Increased postprandial glucose levels can indicate an especially heavy meal, prediabetes or diabetes. Symptoms of diabetes include loss of weight without trying, frequent urination, increased thirst, tiredness, itchy skin.</p>','','141 - 200','80 - 140','0 - 79','201 - 10000','<p>If you are on anti-diabetic medications, consult with your doctor once in 6 weeks on regulating them.</p>','<p>Avoid overeating during a meal and avoid simple carbs like sugar, white bread. Take low carbohydrate diet (Take less rice, wheat) and include more vegetables, nuts, berries, yoghurt, chicken, fish. Walk for atleast 15 min after a meal. Medications / insulin may be needed for uncontrolled diabetes.</p>','188',NULL,'2023-10-31 03:30:45','0 - 150'),(19,NULL,214,'Serum glutamic oxaloacetic transaminase (SGOT OR AST)',NULL,'<p>Aspartate aminotransferase (AST), also known as serum glutamic-oxaloacetic transaminase (SGOT), is an enzyme that is produced by the liver.</p>','<p>6 months</p>','<p>3 months</p>','Male','<p>-</p>','<p>Significantly increased AST levels can be due to fatty liver disease, alcohol intake, some medications like statins liver damage, heart damage, or muscle injury.</p>','','36 - 55','0 - 35','','56 - 10000','<p>-</p>','<p>The treatment for significantly increased AST levels depends on the underlying cause. Diet less in saturated fat and daily exercise is recommended for mildly increased levels.</p>','214',NULL,'2023-10-31 03:31:39','0 - 150'),(20,NULL,214,'Serum glutamic oxaloacetic transaminase (SGOT OR AST)',NULL,'<p>Aspartate aminotransferase (AST), also known as serum gluta