ge, heart damage, or muscle injury.</p>','','35 - 60','0 - 34','','61 - 10000','<p>-</p>','<p>The treatment for significantly increased ALT levels depends on the underlying cause. Diet less in saturated fat and daily exercise is recommended for mildly increased levels.</p>','217',NULL,'2023-10-31 03:32:28','0 - 150'),(23,NULL,NULL,'Total protein',NULL,'<p>Total protein is a blood test that measures the amount of protein in your blood. Proteins are essential for many bodily functions, including building and repairing tissues, fighting infection, and transporting nutrients throughout the body.</p>','<p></p>','<p></p>','Both','<p>Decreased total protein levels can indicate malnutrition (lack of adequate protein in diet), kidney disease, or liver disease.</p>','<p>Increased total protein levels can indicate dehydration (When you are dehydrated, your body loses water, but not protein. This leads to high total protein levels), inflammation (body produces more proteins), or certain medications.</p>',NULL,'8.1 - 8.8','6.0 - 8.0','0 - 5.9','8.9 - 10000','<p>If the low total protein levels are due to malnutrition, the treatment may involve dietary changes (lentils, almonds, milk, eggs, fish etc) or supplementation. Your doctor may recommend treatment based on the underlying cause to bring your levels back to normal.</p>','<p>The treatment for high total protein levels is usually not necessary. However, if the high total protein levels are due to dehydration, the treatment may involve rehydration.</p>','239',NULL,NULL,'3  - 17 '),(24,NULL,NULL,'Total protein',NULL,'<p>Total protein is a blood test that measures the amount of protein in your blood. Proteins are essential for many bodily functions, including building and repairing tissues, fighting infection, and transporting nutrients throughout the body.</p>','<p></p>','<p></p>','Both','<p>Decreased total protein levels can indicate malnutrition (lack of adequate protein in diet), kidney disease, or liver disease.</p>','<p>Inc