0'),(27,NULL,NULL,'Uric acid',NULL,'<p>Uric acid is a waste product that is produced when the body breaks down purines. Uric acid is normally removed from the body by the kidneys. However, if the body produces too much uric acid or the kidneys are not able to remove it effectively, uric acid can build up in the blood.</p>','<p>6 months</p>','<p>3 months</p>','Male','<p>-</p>','<p>Increased uric acid levels can lead to gout (enlargement and pain around joints), kidney stones, and are linked to increased incidence of heart disease,</p>',NULL,'7.3 - 9.5','3.5 - 7.2','','9.6 - 10000','<p>-</p>','<p>Eating a diet low in purines, Purines are found in many foods, including meat, seafood, and certain vegetables. Drinking plenty of water can help to flush uric acid out of the body. Losing body weight. Exercise. Medications.</p>','257',NULL,NULL,'0 - 150'),(28,NULL,NULL,'Uric acid',NULL,'<p>Uric acid is a waste product that is produced when the body breaks down purines. Uric acid is normally removed from the body by the kidneys. However, if the body produces too much uric acid or the kidneys are not able to remove it effectively, uric acid can build up in the blood.</p>','<p></p>','<p></p>','Female','<p>-</p>','<p>Increased uric acid levels can lead to gout (enlargement and pain around joints), kidney stones, and are linked to increased incidence of heart disease,</p>',NULL,'6.1 - 8.0','2.6 - 6','','8.1 - 10000','<p>-</p>','<p>Eating a diet low in purines, Purines are found in many foods, including meat, seafood, and certain vegetables. Drinking plenty of water can help to flush uric acid out of the body. Losing body weight. Exercise. Medications.</p>','257',NULL,NULL,'0 - 150'),(29,NULL,NULL,'VLDL cholesterol',NULL,'<p>Very-low-density lipoprotein (VLDL) is a type of lipoprotein that transports triglycerides and cholesterol from the liver to the rest of the body. </p>','<p>3 months</p>','<p>6 weeks</p>','Both','<p>-</p>','<p>Increased VLDL cholesterol levels can increase the