lood cells that carries oxygen from the lungs to the rest of the body.&nbsp;</p>',NULL,NULL,'male','<p>Decreased hemoglobin levels can be due to iron deficiency, interstinal worms, anemia, dietary deficiency or chronic diseases</p>','<p>Increased hemoglobin levels can be due to Polycythemia vera, Chronic obstructive lung disease, Living in high altitude and due to some medications</p>','9 - 12.9','17.1 - 20.9','13 - 17','0 - 8.9','21 - 1000','<p>Treatment for low hemoglobin levels may include taking iron supplements, eating a diet rich in iron (Spinach, beans, chickpeas, pumpkin seeds, Fish, red meat etc). Deworming tablets once in a year.</p>','<p>Treatment for high hemoglobin levels depends on finding the underlying cause and correcting it</p>','678','ml','2023-09-13 07:29:22','0 - 200'),(80,NULL,678,'Haemoglobin (hb)','2023-09-13 08:29:52','<p>Hemoglobin is a protein found in red blood cells that carries oxygen from the lungs to the rest of the body.&nbsp;</p>',NULL,NULL,'female','<p>Decreased hemoglobin levels can be due to iron deficiency, interstinal worms, anemia, dietary deficiency or chronic diseases</p>','<p>Increased hemoglobin levels can be due to Polycythemia vera, Chronic obstructive lung disease, Living in high altitude and due to some medications</p>','9 - 11.9','15.1 - 18.9','12 - 15','0 - 8.9','19 - 1000','<p>Treatment for low hemoglobin levels may include taking iron supplements, eating a diet rich in iron (Spinach, beans, chickpeas, pumpkin seeds, Fish, red meat etc). Deworming tablets once in a year.</p>','<p>Treatment for high hemoglobin levels depends on finding the underlying cause and correcting it</p>','678','ml','2023-09-13 08:29:52','0 - 200'),(81,NULL,650,'Neutrophils',NULL,'<p>Neutrophils are the most common type of white blood cell. They fight infection by engulfing and destroying bacteria.&nbsp;</p>',NULL,NULL,'both','<p>Decreased levels can indicate leukopenia, which can be due to aplastic anemia, some medications immune system disorders, or bone marrow suppression.</p>','<p>Increased levels can indicate infection (neutrophils are increased in an attempt to fight off the infection), inflammation (like chronic arthritis or lupus), sternous exercise / stress, or very rarely in some cancers.</p>','','61 - 80','40 - 60','','81 - 1000','<p>If you have a low neutrophil count, your doctor may recommend treatment based on the underlying cause to bring your levels back to normal</p>','<p>If you have a high neutrophil count, your doctor may recommend treatment based on the underlying cause to bring your levels back to normal</p>','650','ml','2023-11-13 10:51:03','16 - 100'),(82,NULL,649,'Lymphocytes','2023-09-13 08:41:04','<p>Lymphocytes are a type of white blood cell that helps the body fight infection and disease. There are two main types of lymphocytes: B cells and T cells. B cells produce antibodies, which help fight infection. T cells help regulate the immune system and fight cancer cells.</p>',NULL,NULL,'both','<p>Decreased lymphocyte levels can indicate lymphopenia, which can be caused due to viral or bacterial infections, aplastic anemia, or bone marrow suppression.</p>','<p>Increased lymphocyte levels can indicate infections like hepatitis, mononucleosis, inflammation, some medications or very rarely in some cancers.</p>','','41 - 55','20 - 40','','56 - 1000','<p>If you have a low lymphocyte count, your doctor may recommend treatment based on the underlying cause to bring your levels back to normal</p>','<p>If you have a high lymphocyte count, your doctor may recommend treatment based on the underlying cause to bring your levels back to normal</p>','649','ml','2023-09-13 08:41:04','0 - 200'),(83,NULL,648,'Eosinophils',NULL,'<p>Eosinophils are a type of white blood cell that helps fight parasites and allergic reactions. They release histamine, which causes inflammation.&nbsp;</p>','<p>3 months</p>','<p>6 weeks</p>','both','<p>Decreased eosinophil levels can indicate hypoeosinophilia, can be caused due to some viral infections, some medications aplastic anemia, or bone marrow suppression.</p>','<p>Increased eosinophil levels can indicate any underlying allergies (asthma, eczema etc), parasitic infections, or some auto immune disorders.</p>','','8 - 15','0 - 6','','16 - 1000','<p>If you have a low eosinophil count, your doctor may recommend treatment based on the underlying cause to bring your levels back to normal</p>','<p>If you have a high eosinophil count, your doctor may recommend an allergy panel blood test to rule out any underlying allergies and try to correct it</p>','648','ml','2023-10-31 03:24:44','0 - 200'),(84,NULL,153,'LDL Cholesterol','2023-09-13 08:49:21','<p>LDL cholesterol, also known as low-density lipoprotein or \'bad\' cholesterol, carries cholesterol from the liver to the rest of the body.</p>',NULL,NULL,'both','<p>Decreased LDL cholesterol levels can be a sign of malnutrition, eating disorders, some medications like statins.</p>','<p>Increased LDL cholesterol can build up in the arteries and is a major risk factor for heart disease and stroke. Conditions which can increase LDL levels are high dietary intake of saturated fat, obesity, physical inactivity, smoking, family history, medications like steroids.</p>','','101 - 159','0 - 100','','160 - 1000','<p>Eating a healthy diet with good unsaturated fat like nuts, avocado, fish etc</p>','<p>Eating a healthy diet (avoiding fried foods, excess oil. include lots of vegetables, taking healthy unsaturated fatty food like fish, nuts, avocado). Exercising regularly, Not taking food atleast 90 minutes before sleeping and Stopping smoking.</p>','153','ml','2023-09-13 08:49:21','0 - 200'),(85,NULL,2430,'Bilirubin Total','2023-09-13 08:52:49','<p>Bilirubin is a yellowish pigment that is made when red blood cells break down. It is normally removed from the body by the liver and gallbladder.</p>',NULL,NULL,'both',NULL,'<p>High levels of bilirubin in the blood can cause jaundice - yellowing of the skin and eyes. High levels can be caused due to liver disease, bild duct obstruction, severe anemia, sometimes due to blood transfusions.</p>','','1.3 - 1.8','0.3 - 1.2','','1.9 - 1000',NULL,'<p>If you have a high bilirubin, your doctor may recommend treatment based on the underlying cause to bring your levels back to normal.</p>','2430',NULL,'2023-09-13 08:52:49','0 - 200'),(86,NULL,2437,'Calcium','2023-09-13 08:56:11','<p>A mineral that is important for Building and maintaining strong bones and teeth, Transmitting nerve impulses, Contracting muscles, Regulating blood clotting, Maintaining a healthy heart rhythm</p>','<p>6 months</p>','<p>3 months</p>','both','<p>Decreased calcium levels can indicate hypocalcemia, which can cause muscle cramps, tingling in the hands and feet, and heart problems. It can be due to not getting enough calcium in diet, vitamin D deficiency (which impairs body\'s absorption of calcium) or rarely in kidney disease.</p>','<p>Increased calcium levels can indicate hypercalcemia, which can cause kidney stones, constipation, heart problems. It can be caused due to over intake of calcium supplements or over active parathyroid glands.&nbsp;</p>','6.5 - 8.5','10.3 - 14','8.6 - 10.2','0 - 6.4','14.1 - 1000','<p>Taking food rich in calcium - milk, yoghurt, spinach, brocolli, beans, almonds, figs. Taking calcium supplements if needed.</p>','<p>Regulate your consumption of calcium supplements by talking to your doctor. Blood test for parathyroid hormone levels may be needed to rule out other diseases.&nbsp;</p>','2437','ml','2023-09-13 08:56:11','0 - 100'),(87,NULL,139,'Iron','2023-09-13 09:20:06','<p>Iron is a mineral that is used to make hemoglobin, a protein in red blood cells that carries oxygen to the body\'s tissues. Iron is also used to make myoglobin, a protein that stores oxygen in muscles.</p>','<p>6 months</p>','<p>3 months</p>','both',NULL,NULL,'25 - 40','','41 - 141','0 - 24','',NULL,NULL,'139','ml','2023-09-13 09:20:06','0 - 100'),(88,NULL,2549,'Ferririn',NULL,'<p>Ferritin is a protein that stores iron in the body. It is found in the liver, spleen, and bone marrow. Ferritin levels can be used to assess iron stores in the body.</p>','<p></p>','<p></p>','Female','<p>Decreased ferritin levels can be due to bleeding disorders, poor dietary intake of iron, pregnancy, heavy periods during menstruation. Symptoms include feeling tired, breathlessness, poor memory, frequent infections.</p>','<p>Increased ferritin levels can be due to frequent blood transfusions, alcoholism, underlying anemia or rarely it can be congenital.</p>','7.6 - 9.9','121 - 140','10 - 120','0 - 7.5','141 - 10000','<p>If you have a low ferritin levels, your doctor may recommend treatment based on the underlying cause to bring your levels back to normal</p>','<p>If you have a high ferritin levels, your doctor may recommend treatment based on the underlying cause to bring your levels back to normal</p>','2549',NULL,'2023-09-21 18:21:09','0 - 150'),(89,NULL,2549,'Ferririn',NULL,'<p>Ferritin is a protein that stores iron in the body. It is found in the liver, spleen, and bone marrow. Ferritin levels can be used to assess iron stores in the body.</p>','<p> </p>','<p> </p>','Male','<p><br></p>','<p> </p>','16 - 19.9','251 - 275','20 - 250','0 - 15','276 - 10000','<p><br></p>','<p><br></p>','2549',NULL,'2023-09-21 18:21:18','0 - 150'),(90,NULL,236,'Total Iron Binding Capacity (TIBC)',NULL,'<p>Total iron-binding capacity (TIBC) is a blood test that measures the amount of iron that can be bound by transferrin, a protein in the blood that carries iron. TIBC should be interpreted in conjunction with other blood tests, such as iron levels and ferritin.</p>','<p></p>','<p></p>','Both','<p>A low TIBC means that there is not enough transferrin available to bind iron, which can be a sign of iron overload.</p>','<p>A high TIBC means that there is a lot of transferrin available to bind iron, which can be a sign of iron deficiency.</p>','','407 - 450','251 - 406','','451 - 10000','<p>TIBC should be interpreted in conjunction with other blood tests, such as iron levels and ferritin.</p>','<p>TIBC should be interpreted in conjunction with other blood tests, such as iron levels and ferritin.</p>','236',NULL,'2023-09-21 18:22:48','0 - 150'),(91,NULL,305,'Phosphorus',NULL,'<p>Phosphorus is an essential mineral that is found in all cells in the body. It is important for Building and maintaining strong bones and teeth, Transmitting nerve impulses, Contracting muscles, Regulating blood sugar levels.</p>','<p></p>','<p></p>','Both','<p>Decreased phosphorus levels can indicate hypophosphatemia, which can cause muscle weakness, bone pain, and heart problems. It can be due to low dietary intake, vitamin D deficiency (which impairs bodys absorption of phosphorus) or rarely in kidney disease.</p>','<p>Increased phosphorus levels can indicate hyperphosphatemia, which can cause constipation, vomitting, fatigue and heart problems. It can be due to over intake of supplements or rarely in kidney disease.</p>','2.2 - 2.4','4.6 - 4.9','2.5 - 4.5','0 - 2.1','5 - 10000','<p>Take food rich in phosphorus like dairy foods, beans, lentils, nuts, oats, eggs. Check for kidney function and vitamin D levels.</p>','<p>If you have a high phosphorus, your doctor may recommend treatment based on the underlying cause to bring your levels back to normal</p>','305',NULL,'2023-11-13 10:30:09','16 - 100');
